import Page2 from './Page2'

export class Todo_list extends Component {


    render() {
        return (
            <div>
                <h1>Person Manager</h1>
                <h5>This is my task</h5>
                <button onClick = {<Page2 />}>Toggle Persons</button>
            </div>
        )
    }
}

export default Todo_list
